                    </video>
                    <div class="textBlock" style="width: 50%;">
                        <h3>Наша система позволяет:</h3>
                        <p class="standartText list">Полностью автоматизировать Ваш заработок</p>
                        <p class="standartText list">Не тратить время на ежедневную рутину</p>
                        <p class="standartText list">Зарабатывать из любого уголка мира</p>
                        <p class="standartText">Если Вы не верите, что такой заработок в интернете может быть прибыльным и стабильным, то теперь у Вас есть шанс убедиться в этом. Заработать можно реально, легально , быстро и просто. Мы готовы гарантировать прибыль всем своим партнёрам , причём сразу же, в первый день. Конечно миллионерами Вы за месяц не станете, но заработаете несколько тысяч в день. И это отличное начало. Мы научим информационному способу заработка онлайн, совершенно бесплатно.</p>
                    </div>
                </div>

